    return (
      <header className="header">
        <ul>
          <li>Home</li>
          <li>Products</li>
          <li>Get a quote</li>
          <li>Our Company</li>
          <li>Blog</li>
          <li>Pages</li>
          <li>Contact us</li>
        </ul>
      </header>
    );
  }

  export default Header;
